import React from 'react';
import { Link } from 'react-router-dom';
import { ListGroup, ListGroupItem } from 'reactstrap';

const Menus=()=>{
    return(
        <ListGroup>
            <Link tag="a" to="/">Home</Link>
            <Link tag="a" to="/">Register Admin</Link>
            <Link tag="a" to="#!">Register Customer</Link>
            <Link tag="a" to="#!">Register Worker</Link>
            <Link tag="a" to="#!">View Admins</Link>
            <Link tag="a" to="#!">View Customers</Link>
            <Link tag="a" to="#!">View Workers</Link>
            <Link tag="a" to="#!">About</Link>
            <Link tag="a" to="#!">Contact Us</Link>
        </ListGroup>
    )
}

export default Menus;
